func (h *WsHandler) AtMeSessionMapByKey(key string) {
	groupId := h.AtMeSessionMap[key].GroupId
	id := h.AtMeSessionMap[key].Id
	time.Sleep(time.Duration(h.appConfig.AtMeSessionAutoDeleteTime) * time.Second)
	_, has := h.AtMeSessionMap[key]
	if has {
		delete(h.AtMeSessionMap, key)
		mcs := []models.MessageChain{
			{
				Type:   "At",
				Target: id,
			},
			{Type: "Plain", Text: " 您的会话已结束"},
		}
		h.client.SendGroupMessage(groupId, mcs)
	}
}

// CheckMessages 比较两个消息链是否相同
func CheckMessages(last, new []models.MessageChain) bool {
	if len(last) != len(new) {
		return false
	}
	q := false
	for i := 0; i < len(last); i++ {
		if last[i].Type == new[i].Type && last[i].Url == new[i].Url && last[i].Text == new[i].Text {
			q = true
		}
	}
	return q
}

// 判断是否是at机器人

func IsAtMe(resp models.RespMessage) bool {
	for _, v := range resp.Data.MessageChain {
		if v.Type == "At" && v.Target == 1060118918 {
			return true
		}
	}
	return false
}
